import './App.css';
import React from 'react';
import { Layer, Rect, Stage } from 'react-konva';
import Block from './components/block';
import Flag from './components/flag';

function App() {
  return (
    <Stage width={window.innerWidth} height={window.innerHeight}>
      <Layer>
        <Block />
        <Flag />
      </Layer>
    </Stage>
  );
}

export default App;
